import React from 'react';
import TripForm from './TripForm'
import { updateTrip, setFormDataForEdit } from '../actions/myTrips'
import { connect } from 'react-redux'



const EditTripFormWrapper = ({ history, updateTrip }) => {

  const handleSubmit = (event, formData, userId, history) => {
    event.preventDefault()
    console.log("in handleSubmit, event is ", event)
    updateTrip({
      ...formData,
      userId
    }, history)
  }
  return  <TripForm history={history} handleSubmit={handleSubmit} />
};

export default connect(null, { updateTrip })(EditTripFormWrapper);
